const HeatMap = ({ data }) => {
  const maxValue = Math.max(...data.filter(item => item.value !== "-").map(item => item.value));

  // Extract unique X and Y labels for the axes
  const xLabels = [...new Set(data.map(item => item.x))];
  const yLabels = [...new Set(data.map(item => item.y))];

  return (
    <div style={{ display: 'grid', gridTemplateColumns: `repeat(${xLabels.length + 1}, 1fr)`, gap: '2px' }}>
      {/* X Axis Labels */}
      <div style={{ fontWeight: 'bold', textAlign: 'center' }}>Y/X</div>
      {xLabels.map((label) => (
        <div key={label} style={{ fontWeight: 'bold', textAlign: 'center' }}>{label}</div>
      ))}

      {/* Y Axis Labels and Heatmap Cells */}
      {yLabels.map((yLabel) => (
        <>
          <div style={{ fontWeight: 'bold', textAlign: 'center' }}>{yLabel}</div>
          {xLabels.map((xLabel) => {
            const item = data.find(item => item.x === xLabel && item.y === yLabel);
            return (
              <div
                key={`${xLabel}-${yLabel}`}
                style={{
                  backgroundColor: item.value === "-" ? 'black' : `rgba(255, 0, 0, ${item.value / maxValue})`,
                  padding: '20px',
                  textAlign: 'center',
                  border: '1px solid #ccc',
                }}
              >
                {item.value}
              </div>
            );
          })}
        </>
      ))}
    </div>
  );
};

